import React from 'react'

function About(props) {
    console.log("props",props);
    // setInterval(textChanger,3000);
    // function textChanger(){
    //     var element = document.getElementById(Math.random()*10);
    //     element.classList.remove("d-none");
    // }
    return (
        <div>
      <section id="welcome-section" className="welcome-section ">
     
      <img className="avatar" src="../../public/images/stephen_Infanto.jpg" alt="stephen Infanto"></img>
        <h1 >Hey there ,I am Stephen Infanto </h1>
  
        {props.tech.map((tec,i)=>{
            return (                
                 <p key={i} id={i} className="d-none">A web developer who loves to work with { tec } </p>
                
        )})}
     </section>
        </div>
    )
}

export default About;
